INSERT INTO `announcement` VALUES (43,'药优优招商业务全面启动',1,'<p><span style=\"font-size:16px\">&nbsp; &nbsp; &nbsp; &nbsp;药优优与2017年3月12日正式启动全国中药材单品种最具优势的供应商招募行动。</span></p><p><span style=\"font-size:16px\">&nbsp; &nbsp; &nbsp; &nbsp;药优优，专注于中药饮片、中成药制造企业供应链管理，依托于沪谯集团多年采购及供应链资源与经验，提供高效精准的优质供应商共享、供应商评估与维护、供应商战略协同发展、采购BPO、账期信用担保等服务，致力于让散乱的中药材供应链变得有计划、有秩序、有规则。目前已与香雪、沪谯、湖北天济、美誉等多家知名企业达成战略合作意向。</span></p>',0,'2017-03-14 14:30:31');
/*!40000 ALTER TABLE `announcement` ENABLE KEYS */;
UNLOCK TABLES;

