/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `article` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `title` varchar(50) CHARACTER SET utf8 NOT NULL COMMENT '标题',
  `content` text CHARACTER SET utf8,
  `url` varchar(256) CHARACTER SET utf8 DEFAULT NULL COMMENT '链接',
  `status` int(5) NOT NULL DEFAULT '1' COMMENT '状态 1启用(发布)，0禁用(草稿)',
  `create_mem` int(11) DEFAULT NULL COMMENT '创建者',
  `create_time` datetime DEFAULT NULL,
  `update_mem` int(11) DEFAULT NULL,
  `update_time` datetime DEFAULT NULL,
  `descript` varchar(64) CHARACTER SET utf8 COLLATE utf8_bin DEFAULT NULL,
  `hits` int(11) DEFAULT '0' COMMENT '点击率',
  `type` int(11) DEFAULT '1' COMMENT '文章类别  1:平台CMS文章 2：药商头条',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=9 DEFAULT CHARSET=latin1 COMMENT='文章表';
