INSERT INTO `article` VALUES (1,'联系我们','&ltp&gt联系我们&lt/p&gt&ltp&gt&ltbr/&gt&lt/p&gt',NULL,1,NULL,'2016-11-01 11:05:22',NULL,'2016-11-25 17:36:02',NULL,0,1),(2,'质量保证','<p>\r\n    我们平台具有从源头产地到加工储运到质量检测都是有严格的管理体系。\r\n</p>\r\n<p>\r\n    产地：我们是联合道地产区的药农种植，采用适宜时间采收，确保了货源的品质。\r\n</p>\r\n<p>\r\n    加工：趁鲜加工，严格按照药典要求生产，确保各项指标均超过先行版药典。\r\n</p>\r\n<p>\r\n    检测：我们有三大企业沪谯，美誉，天济的检测支撑，做到入库品种批批检测。确保了入库品种100%全检合格。\r\n</p>\r\n<p>\r\n    储运：我们有10多万平方的仓储达到国家要求，以及严格的养护体系。\r\n</p>\r\n<p>\r\n    <br/>\r\n</p>',NULL,1,NULL,'2016-11-01 11:06:07',NULL,'2016-12-01 10:10:10',NULL,0,1),(3,'合作协议','<p>合作协议</p>',NULL,1,NULL,'2016-11-01 11:06:22',NULL,'2016-11-01 11:06:22',NULL,0,1),(4,'关于我们','<p><span style=\"font-family: arial, tahoma, &quot;Microsoft Yahei&quot;, 宋体; font-size: 12px; white-space: normal;\">关于我们</span></p>',NULL,1,NULL,'2016-11-01 11:06:37',NULL,'2016-11-01 11:06:37',NULL,0,1),(5,'白芍需求量到底有多大？','<p>我我我我的的</p>','http://127.0.0.1:8189/ms-files/temp/2017/4/3e5c202f-5e43-4b28-847e-8d4ae7386cceCrop.png',1,NULL,'2017-04-21 09:07:17',NULL,'2017-04-23 16:32:06','白芍',100,2),(6,'bais','<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; asasdad</p>','/Software/JAVAEE/apache-tomcat-8.0.23/webapps/ms-files/headline/2017/5/551b75b3-d3a2-41f0-a57e-6f3cd40f8563Crop.png',0,NULL,'2017-05-03 09:36:04',NULL,'2017-05-03 09:36:04','ss',23,2),(7,'阿萨德','<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; 阿斯达奥</p>','/Software/JAVAEE/apache-tomcat-8.0.23/webapps/ms-files/headline/2017/5/607bd438-504d-4906-b525-e16d04cd0fd7Crop.png',0,NULL,'2017-05-03 09:38:23',NULL,'2017-05-03 09:38:23','阿萨德',23,2),(8,'打击“潜规则” 中药质量安全困局待解','<p>&nbsp;在中医常用的600多种药材中，约300种可人工种养。当前我国中药材种植面积超过5000万亩，占全部耕地面积的2.7%。然而，农业部门仅用一般农产品管理方式对待中药材，药监部门则不具备监管药材种养的法定职权和专业能力，中药质量安全状况不容乐观。近年发生的“问题银杏叶”等事件暴露出诸多深层次矛盾，严重威胁公众健康，需要引起高度重视。</p><p>&nbsp;</p><p>&nbsp; &nbsp; 中药产业链条分为种植养殖、流通贮存、加工炮制、处方使用四大环节，横跨一二三产业，涉及农林、药监、工商、商务、中医药等多个政府部门，体系极为复杂。尤其是中药材兼具农产品和药品的双重属性，给中药源头治理带来严峻挑战。</p><p>&nbsp;</p><p>&nbsp; &nbsp; 监管和市场的失灵</p><p>&nbsp;</p><p>&nbsp; &nbsp; 在粗放的农业生产模式下，部门职责缝隙的负面效应被不断放大，产地环境污染、农业投入品使用不当等问题扰乱了中药材生长规律，致使中药药性降低。</p><p>&nbsp;</p><p>&nbsp; &nbsp; 中药材药性还受种子种苗质量、产地环境等因素影响。因此，在特定自然条件地域内所产、较其他地区同种药材品质更好的道地药材，通常受市场青睐。当前我国种子种苗市场较为混乱，产业基础系统性薄弱。例如，位列中国四大药都之一的某地级市，拥有种苗经营许可证的企业仅3家。众多不具备资质的企业和贩子通过异地倒卖赚取差价，导致种子种苗来源混杂，质量缺乏保障。尽管工商、公安、农林部门多次开展联合打击行动，但并未从根本上解决问题。</p><p>&nbsp;</p><p>&nbsp; &nbsp; 与“碎片化”监管体制相伴的是市场失灵。我国药农数以百万计，大多为个体散户，无力抵抗市场风险冲击。受药材产量和价格波动等因素诱导，分散的药农容易实施短期行为，无序采收现象十分普遍。例如，三七的生长周期为5年，市面上的三七多为3年生；黄芩需要长到5寸才能入药，如今往往长到1寸就被挖出来卖；金银花据典应分期采摘花蕾，但不少药农将花蕾、花朵和变黄的花瓣一起采收。中药材种养是一门手艺，栽培技术、采收加工都有讲究。由于市场结构不优，药农经验性和个性化劳动难以被价格机制承认，进一步降低了其提升药材品质的积极性。在监管和市场双重失灵的困境中，中药材的质量安全面临挑战。</p><p>&nbsp;</p><p>&nbsp; &nbsp; 江西省新余市渝水区食品药品监管局对容易发生染色、人工增重、掺杂、掺假的中药材，开展有针对性的抽验。廖海金摄/光明图片</p><p>&nbsp;</p><p>&nbsp; &nbsp; 发展与安全的博弈</p><p>&nbsp;</p><p>&nbsp; &nbsp; 中药材专业市场拥有历史积淀，短则百年，长则上千年。然而20世纪90年代初，各地为发展经济自发形成100多家中药材市场，由于管理不严，为不法分子制售假劣药品提供了渠道。后经国务院清理整顿，全国保留了17家，此后不再新批。国家保留中药材市场的初衷是实现集中管理，并为大宗道地药材提供权威交易平台。然而在利益驱动下，一些中药材市场转变为药材集散地，政策目标与结果相背离。如中部某市中药材市场交易品种超过3000种，达到《中国药典》(2015年版)收录品种的5倍，其中本地药材仅十余种，异地药材占总交易额90%以上，流通追溯体系不健全带来极大监管难度。</p><p>&nbsp;</p><p>&nbsp; &nbsp; 根据“谁开办、谁管理”原则，国家要求中药材市场由地方政府直接领导的市场管理委员会负责。然而在实践中，属地管理容易异化为地方保护。经测算，中药材市场带动的产业链一般占本地生产总值的10%以上，对税收、就业影响极大，重要性不言而喻。如北方某中药材市场年交易额超过130亿元，而市场所在县2015年GDP为108.3亿元，成为名副其实的支柱产业。由于产业扶持与规范监管之间的张力突出，行政执法力度受到影响，有的地方药监部门甚至还承担药材市场招商引资任务。药监管安全、工商管秩序、商务管行业的多头管理体制，更加弱化了监管。以至于国家食药监总局不得不在2013年集体约谈17家中药材市场所在地政府分管领导，并以签署责任书的形式督促地方落实管理责任。</p><p>&nbsp;</p><p>&nbsp; &nbsp; 近年来，地方政府纷纷引入企业作为中药材市场开办方，尽管有助于提高运营效率，但开办方的平台主体责任并未同步落实。笔者在调研中发现，一些中药材市场除主要销售药材外，其内部管理与普通农贸市场基本无异。而在市场周边乡镇，违规仓储、工业染色、水泥增重、非药用部位掺假、非法再加工等情况更是屡见不鲜。一些药材市场内散户占据八成以上，监管力量与市场主体数量严重不匹配。同时依据现行法律，贩卖假药材只能按涉案货品价值的2至5倍处以罚款，金额通常为数百元，低处罚成本与高违法收益形成鲜明反差，中药材市场治理陷入“整顿—收敛—反弹”的循环。</p><p>&nbsp;</p><p>&nbsp; &nbsp; 加工和炮制的乱象</p><p>&nbsp;</p><p>&nbsp; &nbsp; 中药加工环节可细分为产地初加工和炮制两个步骤。初加工是指通过熏蒸和烘干延长中药材贮藏时间，同时保留药用部位以便于运输。媒体上时常有滥用硫磺熏蒸使药材色彩鲜艳的报道，社会关注较多，实际上对中药质量影响更为直接的是炮制。</p><p>&nbsp;</p><p>&nbsp; &nbsp; 炮制是中药产业链条中利润率最高的环节，通过将药材原料制成饮片来加强药效和减除毒性。由于历史的原因，我国中药饮片生产企业多、小、散，绝大多数年产值在1000万元以下，产业结构不优。生产饮片须有专门资质，新版《药品生产质量管理规范(GMP)》实施后，淘汰了近一半饮片企业，产业加速“洗牌”，目前剩余600多家。全国饮片年产量约350吨，总体上供大于求。</p><p>&nbsp;</p><p>&nbsp; &nbsp; 近年来中药材价格持续保持高位运行并伴有波动，中成药却屡遭“降价令”。加之环保标准日趋严格，价格和成本的双向挤压加大了药企生存难度，容易诱发机会主义行为。现实中，不法商贩与个别获证企业勾结，通过出租出借饮片生产经营资质票据，从事私切滥制、变相生产中药饮片活动，譬如用福尔马林、明矾炮制药材。然后违法出售给饮片企业或医疗机构，形成牢固的利益链条。法律规定饮片炮制必须以中药材为起始原料，然而根据国家食药总局披露的案件，一些不法商贩低价收购饮片厂产生的“药渣”，加工后再次销回中药材市场。</p><p>&nbsp;</p><p>&nbsp; &nbsp; 由于监管基础薄弱，国家中药饮片总体未实施批准文号管理，仅对阿胶、鹿角胶等十几个经济利益大的品种发给批准文号。对绝大部分饮片而言，只要符合2001年《药品管理法》颁布之前的国家标准即可生产。标准落后带来质控指标不合理、检测方法不科学等问题。有限的监管力量难以嵌入到生产过程中，药监部门更多依靠化学药的监管思路，通过检验主要成分有无及其含量来判断中药材质量。然而这种末端监管方式面临巨大现实挑战。如三七总皂甙与三七有类似鉴别反应，但两者药效无法相提并论，价格也相差20倍，仅凭检验很难发现非法添加行为。</p><p>&nbsp;</p><p>&nbsp; &nbsp; 完善“明规则” 打击“潜规则”</p><p>&nbsp;</p><p>&nbsp; &nbsp; 归纳而言，理应道道把关的中药质量安全，却在现实中层层失守。中药质量安全困局的本质，是产业发展与监管能力不匹配的结构性矛盾。解铃还须系铃人，从三个维度提出对策建议。</p><p>&nbsp;</p><p>&nbsp; &nbsp; 一是严字当头，打击“潜规则”。中药安全重在监管，负有属地责任的地方政府应当坚持以人民为中心发展理念，处理好发展与安全、扶持与规范的关系。坚持源头严防、过程严管、风险严控，着力维护中药市场流通秩序，解决行业“潜规则”。具体而言，中药材种养大县可借助新一轮机构改革契机，强化乡镇食药监管派出机构与农产品质量监管站的协作，避免分段监管缝隙。中药材市场所在地政府可配备专门机构和专门人员，负责市场管理工作，保障必备经费和检验检测设备，完善市场交易和质量管理规范等规章制度。生产环节应加强飞行检查和体系核查，防范类似“问题银杏叶”事件的系统性风险。</p><p>&nbsp;</p><p>&nbsp; &nbsp; 二是探索产业嵌入型监管政策。发达国家药品安全治理经验表明，强大的产业与强大的监管互为支撑。供给侧结构性改革要求我们优化中药材和饮片产业结构，增加高质量中药产品有效供给，实现中药产业的社会效益和经济效益兼容。《“十三五”国家药品安全规划》已明确提出全面实施中药材生产质量管理规范，云南、贵州等省也出台相关规划。有条件的企业可自建药材基地，引导药农入股，确保药材来源稳定。政府应出台制度并搭建平台，鼓励企业建立药材质量全程追溯体系，用信息技术倒逼药材源头治理。要建立区域性第三方检验机构，引入社会资本参与中药质量安全共治，缓解监管部门技术支撑薄弱问题。</p><p>&nbsp;</p><p>&nbsp; &nbsp; 三是从健康中国战略高度重构中药质量安全体系。习近平总书记强调，将健康融入所有政策。同样地，中药质量安全也要融入相关政策，通过制度重构释放改革红利。一方面，中药材不是普通农产品，而是关系公共安全和人民健康的特殊产品。有关部门决不能以“大棚种菜”的方式对待中药材，而要量身定制一整套制度体系。另一方面，药监部门须革新工作范式，尽快实施中药饮片批准文号管理，出台更加完善的审评、检验、监管措施，规范中药饮片炮制过程，有效保障人民健康福祉。</p><p><br/></p>','E:/development/apache-tomcat-8.0.361/webapps/ms-files/headline/2017/5/64a9a25e-5dc2-4e1e-9750-c29ce17b98bbCrop.jpg',1,NULL,'2017-05-03 09:45:13',NULL,'2017-05-03 09:45:13','中药质量安全',131,2);
