mm，直径3～5mm。表面黄白色或浅棕色，一端尖，另端钝圆。尖端一侧有线形种脐，圆端中央有深色合点，自合点处向上具多条纵向维管束脉纹。种皮薄，子叶2，乳白色，富油性。气微，味微苦。','现行版《中国药典》',696,'/opt/resources/yaobest/commodity/2017/3/a78439f5-8261-4389-a540-b810f615267cCrop.jpg','<p><img src=\"http://static.mall.yaobest.com/ueditor/2017/3/1e65ff8e-4ebd-4b78-97dd-6e93e621dc3e.jpg\" _src=\"http://static.mall.yaobest.com/ueditor/2017/3/1e65ff8e-4ebd-4b78-97dd-6e93e621dc3e.jpg\" style=\"\"/></p><p><img src=\"http://static.mall.yaobest.com/ueditor/2017/3/e3364a0c-122d-4be5-a928-ea768757445a.jpg\" _src=\"http://static.mall.yaobest.com/ueditor/2017/3/e3364a0c-122d-4be5-a928-ea768757445a.jpg\" style=\"\"/></p><p><img src=\"http://static.mall.yaobest.com/ueditor/2017/3/ccf8f9d5-6e84-4593-ace2-1d521f976d8d.jpg\" _src=\"http://static.mall.yaobest.com/ueditor/2017/3/ccf8f9d5-6e84-4593-ace2-1d521f976d8d.jpg\"/></p>',1,'{}',28.00,'1',0,'2017-03-31 08:29:23','2017-03-31 08:29:23',50,'','http://static.mall.yaobest.com/temp/2017/3/c824e359-1235-4acf-b505-0b9a5168abb7Crop.jpg',343,'2017-03-31 08:29:23',0,0,1),(154,'墨旱莲 统 安徽','墨旱莲','6-9月采收','安徽','统','除去杂质，略洗，切段，干燥','本品呈不规则的段。茎圆柱形，表面绿褐色或墨绿色，具纵棱，有白毛，切面中空或有白色髓。叶多皱缩或破碎，墨绿色，密生白毛，展平后，可见边缘全缘或具浅锯齿。头状花序。气微，味微咸。','现行版《中国药典》',1286,'/opt/resources/yaobest/commodity/2017/3/f4924959-a777-4bfa-8ce4-18650a88fc33Crop.jpg','<p><img src=\"http://static.mall.yaobest.com/ueditor/2017/3/06fcc436-de41-4bdd-b2fd-9d2ed83a565c.jpg\" _src=\"http://static.mall.yaobest.com/ueditor/2017/3/06fcc436-de41-4bdd-b2fd-9d2ed83a565c.jpg\" style=\"\"/></p><p><img src=\"http://static.mall.yaobest.com/ueditor/2017/3/d85d6b6b-b889-42fb-acc0-ded6d98df5a9.jpg\" _src=\"http://static.mall.yaobest.com/ueditor/2017/3/d85d6b6b-b889-42fb-acc0-ded6d98df5a9.jpg\" style=\"\"/></p><p><img src=\"http://static.mall.yaobest.com/ueditor/2017/3/b30a0c81-04f4-470f-b937-508c17c012e2.jpg\" _src=\"http://static.mall.yaobest.com/ueditor/2017/3/b30a0c81-04f4-470f-b937-508c17c012e2.jpg\" style=\"\"/></p><p><br/></p>',1,'{}',19.00,'1',0,'2017-03-31 08:44:03','2017-03-31 08:44:03',50,