INSERT INTO `quotation` VALUES (1,'【2017年2月14日】药优优周报价更新',1,'[{\"categoryName\":\"浙江  三棱\",\"categoryId\":\"19\",\"attributes\":[\"规格\",\"药优优报价\",\"亳州市场价\"],\"attrValues\":[{\"commdityId\":\"2\",\"values\":[\"统个、火燎或撞毛、长2cm-6cm、直径2cm-4cm\",\"10.5元/公斤\",\"10.5元/公斤\"]},{\"commdityId\":\"3\",\"values\":[\"过4号筛，直径1cm以上\",\"10.5元/公斤\",\"10.8元/公斤\"]},{\"commdityId\":\"4\",\"values\":[\"过20号筛，直径2cm以上\",\"18元/公斤\",\"-\"]},{\"commdityId\":\"1\",\"values\":[\"三棱，个，浙江，鳞皮去毛，呈圆锥形，略扁，长3cm-6cm直径3cm-4cm\",\"15元/公斤\",\"-\"]}]},{\"categoryName\":\"甘肃  半夏\",\"categoryId\":\"20\",\"attributes\":[\"规格\",\"药优优报价\",\"亳州市场价\"],\"attrValues\":[{\"commdityId\":\"5\",\"values\":[\"统货，过4号筛，直径0.4cm~1.4cm\",\"105元/公斤\",\"105元/公斤\"]},{\"commdityId\":\"6\",\"values\":[\"丙级，6号筛-10号筛之间，直径0.6cm-1cm\",\"120元/公斤\",\"-\"]},{\"commdityId\":\"7\",\"values\":[\"乙级，10号筛-12号筛之间，直径1.0cm-1.2cm\",\"125元/公斤\",\"-\"]},{\"commdityId\":\"8\",\"values\":[\"甲级，12号筛-14号筛之间，直径1.2-cm1.4cm\",\"150元/公斤\",\"-\"]}]},{\"categoryName\":\"亳州  白芍\",\"categoryId\":\"21\",\"attributes\":[\"规格\",\"药优优报价\",\"亳州市场价\"],\"attrValues\":[{\"commdityId\":\"14\",\"values\":[\" 统货，2号筛以上，直径0.2cm以上，厚度2-3mm\",\"15元/公斤\",\"15元/公斤\"]},{\"commdityId\":\"13\",\"values\":[\"亳白芍选片6-16号筛 趁鲜加工 芍药苷1.6 % 5年生 无硫\",\"18元/公斤\",\"21元/公斤\"]}]},{\"categoryName\":\"云南  补骨脂\",\"categoryId\":\"22\",\"attributes\":[\"规格\",\"药优优报价\",\"亳州市场价\"],\"attrValues\":[{\"commdityId\":\"12\",\"values\":[\"过风车，净 长3mm～5mm，宽2mm～4mm\",\"11.5元/公斤\",\"11.5元/公斤\"]}]},{\"categoryName\":\"河南  白附子\",\"categoryId\":\"23\",\"attributes\":[\"规格\",\"药优优报价\",\"亳州市场价\"],\"attrValues\":[{\"commdityId\":\"15\",\"values\":[\"统个，长2-5cm，直径1-3cm\",\"30元/公斤\",\"29元/公斤\"]},{\"commdityId\":\"16\",\"values\":[\"厚片2-4mm，过四号筛\",\"48元/公斤\",\"43元/公斤\"]}]},{\"categoryName\":\"大别山  天麻\",\"categoryId\":\"24\",\"attributes\":[\"规格\",\"药优优报价\",\"亳州市场价\"],\"attrValues\":[{\"commdityId\":\"17\",\"values\":[\"一等个，每个不低于50g；长度11cm以上，宽3.5cm以上\",\"175元/公斤\",\"-\"]},{\"commdityId\":\"18\",\"values\":[\"二等个，每个不低于35g，长度11cm左右，宽3cm以上\",\"155元/公斤\",\"-\"]},{\"commdityId\":\"19\",\"values\":[\"三等个，每个不低于20g，长度8cm以上，宽2.5cm以上\",\"145元/公斤\",\"-\"]},{\"commdityId\":\"20\",\"values\":[\"四等个，每个不低于12g，长度8cm以上，宽2cm以上\",\"120元/公斤\",\"-\"]},{\"commdityId\":\"21\",\"values\":[\"天麻平片（压片），精选大片，宽3.5cm以上\",\"185元/公斤\",\"-\"]},{\"commdityId\":\"22\",\"values\":[\"马蹄片（圆片），过8号筛，直径2cm以上\",\"145元/公斤\",\"-\"]},{\"commdityId\":\"23\",\"values\":[\"统片，过10号筛，宽1.0cm-4.0cm\",\"145元/公斤\",\"-\"]},{\"commdityId\":\"24\",\"values\":[\"四级片，过6号筛，宽1.0-2.0cm\",\"120元/公斤\",\"-\"]},{\"commdityId\":\"25\",\"values\":[\"籽片，过6号筛\",\"80元/公斤\",\"-\"]}]}]','<p><span style=\"font-size:18px\"> &nbsp; &nbsp; &nbsp;药优优平台周报价每周更新，就小优上周上行来看市场行情大致是这样滴：</span></p><p><span style=\"font-size:18px\">&nbsp; &nbsp; &nbsp;市场上<strong>半夏</strong>价格一直很稳定，从去年10月份亳州最大的半夏供应商入驻药优优以来统装无硫的价格一直是<strong>105元/公斤</strong>。<strong>三棱</strong>也是这样，市场上的统个也一直是<strong>10.5元/公斤</strong>在卖，片子是<strong>10.8元/公斤</strong>，</span><span style=\"font-size: 18px;\">最近市场上的</span><span style=\"font-size: 18px;\"><strong>补骨脂</strong></span><span style=\"font-size: 18px;\">有些掉价了，年前是</span><span style=\"font-size: 18px;\">12元/公斤</span><span style=\"font-size: 18px;\">，现在是<strong>11.5元/公斤</strong>。<strong>白附子</strong>统货市场价<strong>29元/公斤</strong>，片子<strong>43元/公斤</strong>，啊？比我们药优优的便宜小优接受不了！！所以小优特地去看了几家的货，这下小优就放心了。浸出物根本就不达标！！那么你要想要好货的话就来药优优吧，浸出物7.2%，不合格不要钱。</span></p><p><span style=\"white-space: normal;\"><span style=\"white-space: normal;font-size:18px\">&nbsp; &nbsp; &nbsp; 再说一下市场需求量巨大的亳州<strong>白芍</strong>，过6-16号筛的选片市场价<strong>21元/公斤</strong>，而药优优只要<strong>18元/公斤</strong>,要的赶紧滴。</span></span></p><p><span style=\"white-space: normal;\"><span style=\"white-space: normal;font-size:18px\">最后再聊一下<strong>天麻</strong>，市场统装货的价格是<strong>115元/公斤</strong>，但小优看了几家的货，没有一家比我们的货好，所以无法在价格上做比较。要么你自己看下面的报价单吧，好天麻，各种规格的我们都有。</span></span></p><p><span style=\"font-size:18px\">药优优的宗旨是：市场上每个品种都有上百家供应商，但<strong><em>药优优只选最好的一家</em></strong>，药优优也陆续会上更多的优质品种。期待中～</span></p><p><span style=\"font-size:18px\"><strong><span style=\"color:#ff0000\">微信公众号搜索“药优优”关注我们～</span></strong></span></p>','2017-02-13 14:32:19','2017-02-14 11:00:53');
