CREATE TABLE `user` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `type` int(11) NOT NULL DEFAULT '1' COMMENT '1 采购商 2 供应商',
  `phone` varchar(11) NOT NULL COMMENT '手机号',
  `password` varchar(50) DEFAULT NULL COMMENT '用户密码',
  `salt` varchar(40) DEFAULT NULL,
  `openid` varchar(32) DEFAULT NULL COMMENT '用户公众号对应的openid',
  `update_time` datetime DEFAULT NULL,
  `create_time` datetime DEFAULT NULL,
  `source` int(11) NOT NULL COMMENT '0注册用户，1申请寄样生成的用户(针对采购商) 10: 后台导入 11: 微信注册 （针对采购商）',
  `status` int(11) DEFAULT '0' COMMENT '0禁用 1启用',
  `verify` int(11) DEFAULT NULL COMMENT '0 未认证 1已认证(主要针对供应商)',
  `supplier_id` int(8) DEFAULT NULL,
  PRIMARY KEY (`id`),
  UNIQUE KEY `phone` (`phone`) USING BTREE,
  UNIQUE KEY `openid` (`openid`)
) ENGINE=InnoDB AUTO_INCREMENT=499 DEFAULT CHARSET=utf8 COMMENT='用户表';
